    function showTooltip(text, position) {
        if (labelHandle) viewer.removeLabel(labelHandle);

            fontColor: 'black',
            showBackground: true,
            inFront: true

    function selectInteraction(id) {
      const data = interactionList.find(i => i.id === id);
      if (!data) return;
      showTooltip(data.label, data.center);

        if (labelHandle) viewer.removeLabel(labelHandle);
